import { AppartList } from "../../Datas/AppartList"
import Presentation from "../../components/Presentation"
import '../../utils/style/Logements.css';
import Background from '../../assets/Background.png';
import { useParams } from "react-router-dom";

function Logements() {


    const { logementId } = useParams();
    console(logementId)
    const LogementDisplayed = AppartList.find((Appart) => Appart.id === logementId);

	if (LogementDisplayed) {
        return (
            <div>
                <img src={Background} alt="banner Logements" className='Logements-banner'/>
                <div className='appart-list'>
                        <Presentation
                            id={ LogementDisplayed.id}
                            title={ LogementDisplayed.title}
                            location= { LogementDisplayed.location}


                        />
                </div>
            </div>
        )
    }

}

export default Logements
